class PattiplayerComponent {
    constructor(constant, router) {
        this.constant = constant;
        this.router = router;
        this.state = "new";
        this.selected = "false";
        this.betState = null;
        this.GameWinner = "JOKER";
        this.player = "Bet for";
        this.odds = null;
        this.IsOneClick = false;
        this.timeLeft = 60;
        this.GameStatus = 1;
        this.quickBet = false;
    }
    startTimer() {
        this.interval = setInterval(() => {
            if (this.timeLeft > 0) {
                this.timeLeft--;
            }
            else {
                this.betState = null;
                this.selected = "false";
                this.state = "new";
                const buttons = document.querySelectorAll('.button');
                buttons.forEach(el => el.classList.remove("active"));
                this.timeLeft = 60;
            }
            // Sequence
            if (this.timeLeft <= 60) {
                this.state = "new";
            }
            if (this.timeLeft <= 50) {
                this.state = "bet";
            }
            if (this.timeLeft <= 20) {
                this.state = "open";
            }
        }, 1000);
    }
    receiveMessage($event) {
        this.quickBet = $event;
    }
    AddBet(player, odds) {
        if (this.GameStatus === 1) {
            if (this.quickBet) {
                this.player = player;
                this.odds = odds;
                new window.bootstrap.Toast(document.getElementById('success')).show();
                // this.ValidateBet();
            }
            else {
                this.player = player;
                this.odds = odds;
            }
        }
        else {
            // this.toastr.error('Betting closed. You can\'t bet right now.');
        }
    }
    ngOnInit() {
        this.GameList = this.constant.gameList;
        this.GameCode = this.router.url.replace('/', '');
        this.CurrentGame = this.GameList[this.GameCode].name;
        this.startTimer();
        const buttons = document.querySelectorAll('.button');
        buttons.forEach(el => el.addEventListener('click', event => {
            buttons.forEach(el => el.classList.remove("active"));
            el.classList.add("active");
            this.selected = "true";
        }));
    }
}
